% Sequential solver 
%
% solve/2 solves an instance by testing n different solutions.
% ============================================
% Example:
% 	project:solve(knapsack:getInstance(ks45), 1000000).
% Tries a million of solutions for instance with identifier ks45 and returns a tuple of three
% elements {Solution, Weight, Profit}, where Solution contains the actual solution found and
% Weight and Profit indicate the total weight and profit packed within the knapsack, respectively.
% ============================================
	% 		{MaxWeight,	ListaOpciones} 					//NumIteraciones
% solve ( {12, [{5, 10}, {4, 7}, {8, 1}, {3, 5}, {7, 10}]} ,  20 )

solveAux(Mask, {SolutionWeight, SolutionProfit}, 0, _) -> {Mask, SolutionWeight, SolutionProfit};
solveAux(OriginalMask, {SolutionWeight, SolutionProfit}, N, {MaxWeight, ListOptions}) -> 
	%	CAMBIAR 0.5 A LO QUE RESPONDA EL PROFE
	MutatedMask = mutate(OriginalMask, 0.1),
	{MutatedWeightSol, MutatedProfitSol} = evaluate(MutatedMask, {MaxWeight, ListOptions}),
	if (SolutionProfit > MutatedProfitSol) ->
		solveAux(OriginalMask, {SolutionWeight, SolutionProfit}, N-1, {MaxWeight, ListOptions});
		true -> solveAux(MutatedMask, {MutatedWeightSol, MutatedProfitSol}, N-1, {MaxWeight, ListOptions})
	end.

solve({MaxWeight, ListOptions}, N) -> 
	RandomMask = rndSolution(length(ListOptions)), %[true,false,true]
	{SolutionWeight, SolutionProfit} = evaluate(RandomMask, {MaxWeight, ListOptions}), % {12, 20}, so far la mejor
	solveAux(RandomMask, {SolutionWeight, SolutionProfit}, N, {MaxWeight, ListOptions}).

